import React from 'react';
import '../../Styles/Utility.css';

const ShowPopupForm = () => {
  return (
    <form className='popupform_grid'>
        <input type="text" name="" id="taskname_input" className='popup_input'/>
        <input type="date" name="" id="taskenddate_input" className='popup_input'/>
        <input type="time" name="" id="taskendtime_input" className='popup_input'/>
        <input type="checkbox" name="" id="taskfavourite_input" className='popup_checkbox'/>
        <input type="checkbox" name="" id="taskcomplete_input" className=''/>
        <button type="reset" id="popupform_rst_btn" className='popup_btn'>Clear</button>
        <button type="submit" id="popupform_submit_btn" className='popup_btn'>Submit</button>
    </form>
  )
};

export default ShowPopupForm;
